              <!--?lit$982101074$--><h1><!--?lit$982101074$-->Archive Team: The Twitter Stream Grab</h1> <!--?lit$982101074$-->
              <!--?lit$982101074$--> <p id="header-summary"><!--?lit$982101074$--><div><b>THIS COLLECTION IS NO LONGER UPDATED AND SHOULD BE CONSIDERED A STATIC DATASET.</b></div><div><br></div>A simple collection of JSON grabbed from the general twitter stream, for the purposes of research, history, testing and memory.&nbsp;<b>This is the "Spritzer" version, the most light and shallow of Twitter grabs.</b>&nbsp;Unfortunately, we do not currently have access to the Sprinkler or Garden Hose versions of the stream.<br><br>from&nbsp;<a href="https://en.wikipedia.org/wiki/Twitter">Wikipedia</a>:&nbsp;<a href="https://twitter.com/">Twitter</a>&nbsp;is an online social networking service and microblogging service that enables its users to send and read text-based messages of up to 140 characters, known as "tweets".</p>  <!--?lit$982101074$--> <button id="more-btn">
